        public void ToString(
            IWeatherGetter item,
            FileGeneration fg,
            string? name = null,
            Weather.Mask<bool>? printMask = null)
        {
            if (name == null)
            {
                fg.AppendLine($"Weather =>");
            }
            else
            {
                fg.AppendLine($"{name} (Weather) =>");
            }
            fg.AppendLine("[");
            using (new DepthWrapper(fg))
            {
                ToStringFields(
                    item: item,
                    fg: fg,
                    printMask: printMask);
            }
            fg.AppendLine("]");
        }
        
